import './Home_game.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import Button from 'react-bootstrap/Button';
import React from 'react';

function Home_game() {
    return (
        <div className="h-100 d-flex flex-column">
            {/* Titre en haut */}
            <h1 className="title bg-primary text-white">PONG</h1>

            {/* Conteneur principal */}
            <div className="row h-100">
                {/* Colonne gauche */}
                <div className="col d-flex justify-content-center align-items-center">
                    <Button type="submit" className="btn-primary">Play</Button>
                </div>
                {/* Colonne droite */}
                <div className="col d-flex justify-content-center align-items-center">
                    <Button type="submit" className="btn-warning">Tournement</Button>
                </div>
            </div>
        </div>
    );
};

export default Home_game;
